@font-face {
  font-family: "Rubik-Bold";
  src: url("../fonts/Rubik-Bold.ttf") format("TrueType");
}
@font-face {
  font-family: "Rubik-Medium";
  src: url("../fonts/Rubik-Medium.ttf") format("TrueType");
}
@font-face {
  font-family: "Rubik-Light";
  src: url("../fonts/Rubik-Light.ttf") format("TrueType");
}
@font-face {
  font-family: "Karla-Regular";
  src: url("../fonts/Karla-Regular.ttf") format("TrueType");
}
html,
body {
  overflow-x: hidden;
  height: auto;
}

.core {
  position: relative;
}
.core section {
  scroll-snap-align: start;
  position: relative;
  height: 100vh;
}
.core h2,
.core h3,
.core h5 {
  font-family: "Rubik-Bold", Geneva, Verdana, sans-serif;
}
.core h2.centered,
.core h3.centered,
.core h5.centered {
  font-family: "Rubik-Bold", Geneva, Verdana, sans-serif;
  padding-bottom: 15px;
  border-bottom: 1px solid #d1d1d1;
  width: fit-content;
  position: relative;
  margin: 0 auto 30px;
}
.core h5 {
  margin: 0 auto 10px;
}
.core p {
  font-family: "Karla-Regular", Geneva, Verdana, sans-serif;
  font-size: 16px;
}
.core p.large {
  font-size: 20px;
}
.core__content {
  position: relative;
  top: 50%;
  transform: translateY(-50%);
}
.core__main {
  height: 100vh;
  overflow-y: scroll;
  scroll-snap-type: mandatory;
  /* for older browsers */
  scroll-snap-points-y: repeat(100vh);
  /* for older browsers */
  scroll-snap-type: y mandatory;
}
.core__scroll-progress {
  position: absolute;
  top: 0;
  left: 0;
  position: absolute;
  height: 4px;
  width: 0%;
  background: #6ddcbd;
}
.core__scroll-progress__container {
  display: none;
  position: fixed;
  top: 0;
  width: 100%;
  height: 4px;
  background: #e4e4e4;
  z-index: 100;
}
.core__scroll-top {
  position: fixed;
  bottom: 0;
  right: 20px;
  color: #6ddcbd;
  font-size: 40px;
  cursor: pointer;
  z-index: 10;
  transition: all 0.2s ease;
  opacity: 0;
  display: none;
}
.core__scroll-top:hover {
  bottom: 6%;
  transition: all 0.2s ease;
}
.core__theme-switch {
  position: fixed;
  bottom: 10px;
  left: 20px;
  font-size: 36px;
  cursor: pointer;
  opacity: 1;
  z-index: 10;
  transition: all 0.2s ease;
}
.core__theme-switch .far {
  color: #9a9a9a;
  opacity: 0.6;
}
.core__theme-switch .fas {
  color: #5e4ae3;
}
.core__theme-switch__label {
  position: fixed;
  left: 60px;
  bottom: 20px;
  font-size: 16px;
  background: transparent;
  border-radius: 20px;
  color: #5e4ae3;
  padding: 4px 8px;
  display: none;
  border: 2px solid #5e4ae3;
  z-index: 10;
}
.core__footer {
  position: absolute;
  bottom: 0;
  right: 2%;
}
.core__footer p {
  color: #8a8a8a;
}
.core__footer p:first-of-type {
  margin-bottom: 0;
}
.core__footer i {
  color: #ffffff;
}
.core__footer i.fa-heart {
  color: red;
}
.core__footer a {
  margin-right: 10px;
  cursor: pointer;
}
.core.dark {
  background: #141414;
  color: #ffffff;
}
.core.dark .core__toggle__box {
  background: #ffffff;
  border-color: #5e4ae3;
}
.core.dark .core__toggle__box__outer {
  color: #5e4ae3;
}
.core.dark .core__toggle__slider {
  background-color: #5e4ae3;
}
.core.dark .core__toggle__slider:before {
  background: #ffffff;
}
.core.dark .core__toggle__slider:after {
  color: #5e4ae3;
}
.core.dark .core__scroll-progress__container {
  background: #141414;
}
.core.dark .edex {
  background: #090909;
}
.core.dark .map__shadow {
  box-shadow: inset 0 -10px 50px 85px #141414;
}
.core.dark .skills__box i.fa-github {
  color: #ffffff;
}
.core.dark .skills__box__loader {
  box-shadow: 0 0 20px #000;
  background: #141414;
}
.core.dark .skills__box__loader:before {
  box-shadow: none;
}
.core.dark .skills__box__loader__inner.github {
  background: #ffffff;
}
.core.dark .projects__modal {
  background: #141414;
  color: #ffffff;
}
.core.dark .projects__modal__title {
  background: #141414;
}
.core.dark .projects__inner__box {
  box-shadow: 0 0 60px #000;
  background: #141414;
  color: #ffffff;
}
.core.dark .projects__inner__box__text a,
.core.dark .projects__inner__box__text i {
  color: #6ddcbd;
}
.core.dark .nav__container {
  background: #141414;
  box-shadow: 0 0 20px #000;
}
.core.dark .nav__scroll-down, .core.dark .nav__name {
  color: #ffffff;
}
.core.dark .nav__social__item i.fa-github {
  color: #ffffff;
}
.core.dark .nav__logo {
  color: #ffffff;
}
.core.dark .nav__mobile__background {
  background: #141414;
  box-shadow: 0 0 25px #000;
}
.core.dark .nav__mobile__hamburger-icon {
  background: #ffffff;
}
.core.dark .nav__mobile__hamburger-icon:before, .core.dark .nav__mobile__hamburger-icon:after {
  background: #ffffff;
}
.core.dark .nav__mobile__hamburger-icon-container.active span:before, .core.dark .nav__mobile__hamburger-icon-container.active span:after {
  background: #ffffff;
}
.core.dark .nav__mobile__items__item {
  color: #ffffff;
}
.core.dark .nav__mobile__items__item__social i {
  color: #ffffff;
}
.core.dark .nav__mobile.active .nav__mobile__items__item {
  color: #ffffff;
}
.core.dark .nav__mobile.active .nav__mobile__items__item.active {
  color: #141414;
  --webkit-transition: all 0.7s ease-in-out;
  -moz-transition: all 0.7s ease-in-out;
  -o-transition: all 0.7s ease-in-out;
  transition: all 0.7s ease-in-out;
}
.core.dark .nav__mobile.active .nav__mobile__items__item.active:after {
  background: #ffffff;
  width: 80%;
  transition-delay: 0.5s;
  --webkit-transition: all 0.3s ease-in-out;
  -moz-transition: all 0.3s ease-in-out;
  -o-transition: all 0.3s ease-in-out;
  transition: all 0.3s ease-in-out;
}
.core.dark .binary__content {
  background: #141414;
  color: #ffffff;
}
.core.dark .binary__content input {
  background: #000;
  color: #ffffff;
}
@media only screen and (max-width: 1023px) {
  .core__scroll-progress__container {
    display: block;
  }
  .core__content {
    top: 0;
    transform: none;
  }
  .core__scroll-top {
    display: block;
  }
  .core__scroll-top:hover {
    bottom: 2%;
  }
  .core.dark .nav__logo {
    color: #ffffff;
  }
  .core.dark .nav__container {
    box-shadow: none;
  }
  .core.dark .map__shadow {
    box-shadow: inset 0 0 25px 80px #141414;
    height: 105%;
  }
  .core.dark .skills__box__loader {
    box-shadow: 0 0 25px #000;
  }
  .core.dark .projects__inner__box {
    box-shadow: 0 0 20px #000;
  }
  .core__footer {
    width: 100%;
    margin: 0 auto;
    text-align: center;
    right: 0;
    bottom: 0;
  }
  .core__footer p {
    font-size: 12px;
  }
  .core__main {
    max-height: none;
    height: auto;
    scroll-snap-type: none;
  }
  .core__main section {
    scroll-snap-align: none;
    scroll-snap-type: none;
    height: auto;
  }
  .core__main section.binary {
    height: 100vh;
  }
}
@media only screen and (max-width: 639px) {
  .core__toggle {
    width: 53px;
    height: 29px;
  }
  .core__toggle__box {
    width: 90px;
    height: 200px;
  }
  .core__toggle__box__outer {
    font-size: 16px;
    left: 6px;
  }
  .core__toggle__slider:after {
    right: -120px;
    font-size: 14px;
  }
  .core__toggle__slider:before {
    height: 23px;
    width: 23px;
  }
}

.nav {
  width: 100%;
  position: relative;
  padding: 15px 40px;
  font-size: 14px;
  font-family: "Rubik-Light", Geneva, Verdana, sans-serif;
}
.nav__name {
  display: none;
}
.nav__scroll-down, .nav__name {
  position: absolute;
  width: 100%;
  text-align: center;
  color: #0a0a0a;
  margin-bottom: 0;
  left: 50%;
  transform: translateX(-50%);
}
.nav__scroll-down p, .nav__name p {
  font-family: "Rubik-Bold", Geneva, Verdana, sans-serif;
  display: inline-block;
  margin: 0 15px;
}
.nav__scroll-down i, .nav__name i {
  position: absolute;
  margin-left: -5px;
  display: inline-block;
  animation: bounce;
  animation-iteration-count: infinite;
  animation-duration: 1s;
}
.nav__container {
  position: fixed;
  width: 100%;
  background: #ffffff;
  z-index: 10;
  box-shadow: 0 0 5px 0px rgba(0, 0, 0, 0.1);
}
.nav__logo {
  top: 45%;
  transform: translateY(-50%);
  position: absolute;
  display: inline;
  left: 40px;
  font-family: variex, sans-serif;
  font-weight: 400;
  font-style: normal;
  font-size: 34px;
  color: #000;
}
.nav__logo.active {
  color: #ffffff;
}
.nav__social {
  text-align: right;
  position: relative;
  top: 50%;
  transform: translateY(-50%);
}
.nav__social__item {
  display: inline-block;
  padding: 0 5px;
}
.nav__social__item i {
  font-size: 24px;
}
.nav__social__item i.fa-linkedin {
  color: #0e76a8;
}
.nav__social__item i.fa-github {
  color: #000;
}
.nav__social__item i:hover {
  cursor: pointer;
  animation: shake 700ms infinite;
  animation-timing-function: linear;
}
.nav__mobile {
  display: none;
}
.nav__mobile.active .nav__mobile__items {
  right: 0;
  top: 85px;
  z-index: 3;
  --webkit-transition: all 0.2s ease-in-out;
  -moz-transition: all 0.2s ease-in-out;
  -o-transition: all 0.2s ease-in-out;
  transition: all 0.2s ease-in-out;
}
.nav__mobile.active .nav__mobile__hamburger-icon {
  transform: rotate(45deg) translate(-3px, -3px);
  transition: all 0.2s ease;
}
.nav__mobile.active .nav__mobile__hamburger-icon:before, .nav__mobile.active .nav__mobile__hamburger-icon:after {
  top: 0;
  background: white;
  transition: all 0.2s ease;
}
.nav__mobile.active .nav__mobile__hamburger-icon:before {
  transform: rotate(90deg);
}
.nav__mobile__background {
  position: absolute;
  width: 100%;
  height: 100%;
  background: #5e4ae3;
  transition: all 0.4s ease-in-out;
  right: -100%;
  z-index: 5;
  display: none;
}
.nav__mobile__background.active {
  right: 0;
  transition: all 0.2s ease-in-out;
}
.nav__mobile__hamburger-icon {
  transform: translateY(-50%);
  top: 50%;
  content: "";
  position: absolute;
  height: 5px;
  width: 100%;
  background: black;
  transition: all 0.4s ease;
}
.nav__mobile__hamburger-icon:before, .nav__mobile__hamburger-icon:after {
  content: "";
  position: absolute;
  height: 5px;
  width: 100%;
  background: black;
  transition: all 0.5s ease;
}
.nav__mobile__hamburger-icon:before {
  top: -200%;
}
.nav__mobile__hamburger-icon:after {
  top: 200%;
}
.nav__mobile__hamburger-icon-container {
  position: absolute;
  right: 3%;
  cursor: pointer;
  width: 50px;
  height: 50px;
  display: inline-block;
  z-index: 5;
}
.nav__mobile__items {
  position: relative;
  width: 100%;
  right: -100%;
  top: 85px;
  height: 0;
  z-index: -1;
  /* So the menu doesn't cover the hamburger icon when it's hidden */
  --webkit-transition: all 0.3s ease-in-out;
  -moz-transition: all 0.3s ease-in-out;
  -o-transition: all 0.3s ease-in-out;
  transition: all 0.3s ease-in-out;
}
.nav__mobile__items__item {
  text-align: right;
  margin: 5px 0;
  font-size: 80px;
  color: #ffffff;
}
.nav__mobile__items__item__social {
  text-align: right;
  display: block;
  height: 45px;
}
.nav__mobile__items__item__social i {
  color: #ffffff;
  border-radius: 5px;
  padding: 8px;
  font-size: 30px;
}
.nav__mobile__items__item:after {
  content: "";
  background: #ffffff;
  width: 0;
  position: absolute;
  right: -18px;
  z-index: -10;
  height: 115px;
  transition-delay: 0.5s;
  --webkit-transition: all 0.2s ease-in-out;
  -moz-transition: all 0.2s ease-in-out;
  -o-transition: all 0.2s ease-in-out;
  transition: all 0.2s ease-in-out;
}
.nav__mobile__items__item.active {
  color: #5e4ae3;
  --webkit-transition: all 0.2s ease-in-out;
  -moz-transition: all 0.2s ease-in-out;
  -o-transition: all 0.2s ease-in-out;
  transition: all 0.2s ease-in-out;
}
.nav__mobile__items__item.active:after {
  width: 80%;
  transition-delay: 0.5s;
  --webkit-transition: all 0.2s ease-in-out;
  -moz-transition: all 0.2s ease-in-out;
  -o-transition: all 0.2s ease-in-out;
  transition: all 0.2s ease-in-out;
}
.nav__mobile__items ul {
  list-style: none;
}
.nav__mobile__items li {
  position: relative;
  padding: 10px 0;
  text-align: left;
  color: #ababab;
  left: 0;
  font-size: 20px;
  --webkit-transition: all 0.3s ease-in-out;
  -moz-transition: all 0.3s ease-in-out;
  -o-transition: all 0.3s ease-in-out;
  transition: all 0.3s ease-in-out;
}
.nav__mobile__items li:hover {
  color: #141414;
  cursor: pointer;
  left: 10px;
  --webkit-transition: all 0.3s ease-in-out;
  -moz-transition: all 0.3s ease-in-out;
  -o-transition: all 0.3s ease-in-out;
  transition: all 0.3s ease-in-out;
}
@media only screen and (max-width: 1023px) {
  .nav__container {
    position: relative;
    box-shadow: none;
    background: none;
  }
  .nav__logo {
    transform: none;
    font-size: 55px;
    top: 20%;
    left: 2%;
  }
  .nav__mobile {
    display: block;
  }
  .nav__mobile__background {
    display: block;
  }
  .nav__mobile__hamburger-icon {
    height: 7px;
  }
  .nav__mobile__hamburger-icon-container {
    height: 85px;
    width: 70px;
    top: 20%;
  }
  .nav__mobile__hamburger-icon:before, .nav__mobile__hamburger-icon:after {
    height: 7px;
  }
  .nav__social {
    display: none;
  }
}
@media only screen and (max-width: 639px) {
  .nav__mobile.active .nav__mobile__items {
    top: 85px;
  }
  .nav__mobile__items__item {
    font-size: 32px;
  }
  .nav__mobile__items__item:after {
    height: 48px;
  }
  .nav__mobile__hamburger-icon-container {
    height: 60px;
    width: 60px;
    top: 50%;
  }
}

@keyframes shake {
  0% {
    transform: rotate(15deg);
  }
  50% {
    transform: rotate(-15deg);
  }
  100% {
    transform: rotate(15deg);
  }
}
@keyframes bounce {
  0% {
    top: 10%;
  }
  50% {
    top: 35%;
  }
  100% {
    top: 10%;
  }
}
.map {
  position: relative;
  overflow: hidden;
}
.map__name {
  top: 0%;
  position: relative;
  opacity: 0;
}
.map__name h2 {
  font-family: "Rubik-Bold", Geneva, Verdana, sans-serif;
  text-transform: uppercase;
  color: #5e4ae3;
  margin-bottom: 20px;
  font-size: 40px;
}
.map__name.loaded {
  animation: textDropIn-10;
  animation-duration: 0.85s;
  animation-delay: 0.2s;
  animation-fill-mode: forwards;
}
.map__text {
  position: absolute;
  top: 0%;
  transform: translateY(-50%);
  opacity: 0;
}
.map__text.loaded {
  animation: textDropIn-50;
  animation-duration: 0.85s;
  animation-fill-mode: forwards;
}
.map__text__container {
  position: absolute;
  height: 400px;
  width: 50%;
  top: 50%;
  transform: translateY(-50%);
  z-index: 3;
  max-width: 750px;
  left: 5%;
}
.map__text h1 {
  font-family: "Rubik-Bold", Geneva, Verdana, sans-serif;
  text-transform: uppercase;
  line-height: 3.5rem;
  font-weight: 600;
  font-size: 50px;
}
.map__googlemap {
  width: 100%;
  right: 0;
  position: absolute;
  height: 104%;
  top: 0;
}
.map__shadow {
  position: absolute;
  top: 0;
  left: 50%;
  transform: translateX(-50%);
  width: 150%;
  height: 100%;
  box-shadow: inset 0 -10px 50px 85px #ffffff;
  z-index: 2;
  display: none;
}
.map__container {
  position: relative;
  height: 100%;
  width: 100%;
  right: 0;
  margin: 0 auto;
  pointer-events: none;
  overflow: hidden;
}
@media only screen and (max-width: 1023px) {
  .map {
    height: auto;
  }
  .map__container {
    height: 400px;
    right: 0;
    border-radius: 0;
  }
  .map__name {
    position: relative;
    padding: 0;
  }
  .map__name h2 {
    line-height: 1rem;
  }
  .map__googlemap {
    width: 149%;
    left: 50%;
    transform: translateX(-50%);
    border-radius: 0;
    top: 15px;
    height: 100%;
  }
  .map__shadow {
    display: block;
  }
  .map__text {
    padding: 0;
  }
  .map__text__container {
    position: relative;
    margin: 0 auto;
    text-align: center;
    top: 100px;
    width: 90%;
    margin: 0;
    left: 50%;
    transform: translateX(-50%);
  }
}
@media only screen and (max-width: 639px) {
  .map__name h2 {
    font-size: 2em;
    line-height: 1em;
  }
  .map__text h1 {
    font-size: 36px;
    line-height: 1.2em;
  }
  .map__text__container {
    width: 95%;
  }
}

@keyframes textDropIn-50 {
  0% {
    top: 0%;
    opacity: 0;
  }
  50% {
    top: 53%;
  }
  100% {
    top: 50%;
    opacity: 1;
  }
}
@keyframes textDropIn-10 {
  0% {
    top: 0%;
    opacity: 0;
  }
  50% {
    top: 11%;
  }
  100% {
    top: 10%;
    opacity: 1;
  }
}
.binary {
  position: relative;
  width: 100%;
  height: 600px;
}
.binary canvas {
  position: absolute;
  width: 100%;
  height: 100%;
}
.binary__content {
  position: absolute;
  top: 45%;
  left: 50%;
  max-width: 90%;
  height: auto;
  transform: translate(-50%, -50%);
  background: #ffffff;
  border-radius: 4px;
  padding: 25px;
  color: #0a0a0a;
  box-shadow: 0 0 50px #000;
}
.binary__content i {
  font-size: 20px;
  cursor: pointer;
}
.binary__content input {
  display: inline-block;
  border-radius: 4px;
  border: none;
  background: #f8f8f8;
  width: 75%;
  margin-right: 10px;
}
.binary__content button {
  position: relative;
}
.binary__content button i {
  color: #6ddcbd;
}
.binary__content button:after {
  position: relative;
  color: #8a8a8a;
  content: "OR";
  margin: 0 10px;
}
@media only screen and (max-width: 1023px) {
  .binary__content {
    width: 75%;
  }
}
@media only screen and (max-width: 639px) {
  .binary {
    margin-top: -100px;
  }
  .binary__content {
    text-align: center;
  }
  .binary__content input {
    margin: 0 auto 20px;
    text-align: center;
    display: block;
    width: 100%;
  }
}

.skills {
  position: relative;
  margin: 0 2% 100px;
}
.skills__box {
  position: relative;
  padding: 30px 60px;
  text-align: center;
}
.skills__box img {
  width: 40px;
  vertical-align: bottom;
}
.skills__box i,
.skills__box img {
  position: relative;
  margin-right: 10px;
  display: inline-block;
  font-size: 46px;
}
.skills__box i.fa-html5,
.skills__box img.fa-html5 {
  color: #e34c26;
}
.skills__box i.fa-sass,
.skills__box img.fa-sass {
  color: #cc6699;
}
.skills__box i.fa-js-square,
.skills__box img.fa-js-square {
  color: #f0db4f;
}
.skills__box i.fa-python,
.skills__box img.fa-python {
  color: #306998;
}
.skills__box i.fa-github,
.skills__box img.fa-github {
  color: #1d202d;
}
.skills__box__loader {
  position: relative;
  display: inline-block;
  padding: 12px;
  width: 60%;
  height: auto;
  border-radius: 23px;
  background: #ffffff;
  box-shadow: 5px 5px 24px #e8e8e8, -5px -5px 24px #ffffff;
}
.skills__box__loader:before {
  position: absolute;
  top: -45px;
